-- ----------------------------
-- Table structure for contract
-- ----------------------------
DROP TABLE IF EXISTS `contract`;
CREATE TABLE `contract`
(
    `contract_id`       varchar(32) NOT NULL COMMENT '合同id',
    `tender_id`         varchar(22)  DEFAULT NULL COMMENT '标书id',
    `contract_type`     char(1)      DEFAULT NULL COMMENT '0代表供应商与供销社1代表小商超与供销社',
    `contract_document` varchar(200) DEFAULT NULL COMMENT '合同文件地址',
    `signature_a`       char(1)      DEFAULT NULL COMMENT '甲方是否签名0未签1签',
    `signature_b`       char(1)      DEFAULT NULL COMMENT '乙方是否签名0未签1签',
    `contract_time`     datetime     DEFAULT NULL COMMENT '合同签定时间',
    PRIMARY KEY (`contract_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb3 COMMENT ='合同';

