    `outbound_order_id` bigint                                  DEFAULT NULL COMMENT '商品出库主表ID',
    `shop_goods_id`     bigint                                  DEFAULT NULL COMMENT '商品主键ID',
    `shop_goods_code`   varchar(32) COLLATE utf8mb4_general_ci  DEFAULT NULL COMMENT '商品编码',
    `shop_goods_name`   varchar(64) COLLATE utf8mb4_general_ci  DEFAULT NULL COMMENT '商品名称',
