    `storage_type`      char(1) COLLATE utf8mb4_general_ci      DEFAULT NULL COMMENT '库位类型(数据字典：收货、发货、存储、暂存、良品、不良等)',
    `storage_attribute` char(1) COLLATE utf8mb4_general_ci      DEFAULT NULL COMMENT '库位属性(数据字典：冷藏、恒温、常温等)',
    `storage_size_id`   bigint                                  DEFAULT NULL COMMENT '库位尺寸主键',
    `outbound`          varchar(32) COLLATE utf8mb4_general_ci  DEFAULT NULL COMMENT '出库口',
    `is_empty`          char(1) COLLATE utf8mb4_general_ci      DEFAULT 'Y' COMMENT '空库位标识(Y是 N否)',
    `is_disable`        char(1) COLLATE utf8mb4_general_ci      DEFAULT '0' COMMENT '是否停用(0:正常 1:停用)',
    `del_flag`          char(1) COLLATE utf8mb4_general_ci      DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
    `create_by`         varchar(64) COLLATE utf8mb4_general_ci  DEFAULT '' COMMENT '创建者',
    `create_time`       datetime                                DEFAULT NULL COMMENT '创建时间',
    `update_by`         varchar(64) COLLATE utf8mb4_general_ci  DEFAULT '' COMMENT '更新者',
    `update_time`       datetime                                DEFAULT NULL COMMENT '更新时间',
    `remark`            varchar(500) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
    `dept_id`           bigint NOT NULL COMMENT '部门ID',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  AUTO_INCREMENT = 5
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci COMMENT ='库位(储位)设置';

