-- ----------------------------
-- Table structure for wms_wh_warehousing_order
-- ----------------------------
DROP TABLE IF EXISTS `wms_wh_warehousing_order`;
CREATE TABLE `wms_wh_warehousing_order`
(
    `id`                 bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
    `order_type`         char(1) COLLATE utf8mb4_general_ci      DEFAULT NULL COMMENT '入库类型(其他入库、采购入库)',
    `order_code`         varchar(32) COLLATE utf8mb4_general_ci  DEFAULT NULL COMMENT '入库单编号',
    `order_name`         varchar(64) COLLATE utf8mb4_general_ci  DEFAULT NULL COMMENT '订单号',
    `order_date`         date                                    DEFAULT NULL COMMENT '订单日期',
    `supplier_id`        bigint                                  DEFAULT NULL COMMENT '供应商主键ID',
    `supplier_name`      varchar(64) COLLATE utf8mb4_general_ci  DEFAULT NULL COMMENT '供应商名称',
    `warehouse_id`       bigint                                  DEFAULT NULL COMMENT '单位关系主键ID',
    `des_warehouse_id`   bigint                                  DEFAULT NULL COMMENT '对象单位主键ID',
    `des_warehouse_name` varchar(64) COLLATE utf8mb4_general_ci  DEFAULT NULL COMMENT '对象单位名称',
    `rate`               decimal(15, 2)                          DEFAULT '0.00' COMMENT '税率',
    `tax`                decimal(15, 2)                          DEFAULT '0.00' COMMENT '税额',
    `discount_rate`      decimal(15, 2)                          DEFAULT '1.00' COMMENT '折扣率',
    `discount_amount`    decimal(15, 2)                          DEFAULT '0.00' COMMENT '折扣金额',
    `discount_price`     decimal(15, 2)                          DEFAULT '0.00' COMMENT '折让金额',
    `other_fee`          decimal(15, 2)                          DEFAULT '0.00' COMMENT '其他费用',
    `untaxed_amount`     decimal(15, 2)                          DEFAULT '0.00' COMMENT '未税金额',
    `total_amount`       decimal(15, 2)                          DEFAULT '0.00' COMMENT '含税金额',
    `status`             char(1) COLLATE utf8mb4_general_ci      DEFAULT NULL COMMENT '状态(待到货、待卸货、待分拣、已分拣)',
    `outbound_order_id`  bigint                                  DEFAULT NULL COMMENT '关联出库单主键',
    `del_flag`           char(1) COLLATE utf8mb4_general_ci      DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
    `create_by`          varchar(64) COLLATE utf8mb4_general_ci  DEFAULT '' COMMENT '创建者',
    `create_time`        datetime                                DEFAULT NULL COMMENT '创建时间',
    `update_by`          varchar(64) COLLATE utf8mb4_general_ci  DEFAULT '' COMMENT '更新者',
    `update_time`        datetime                                DEFAULT NULL COMMENT '更新时间',
    `remark`             varchar(500) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
    `dept_id`            bigint NOT NULL COMMENT '部门ID',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  AUTO_INCREMENT = 21
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci COMMENT ='商品入库单主表';

