DROP TABLE IF EXISTS `wms_wh_warehousing_order_seed`;
CREATE TABLE `wms_wh_warehousing_order_seed`
(
    `id`                   bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
    `warehousing_order_id` bigint                                  DEFAULT NULL COMMENT '商品入库主表ID',
    `shop_goods_id`        bigint                                  DEFAULT NULL COMMENT '商品主键ID',
    `shop_goods_code`      varchar(32) COLLATE utf8mb4_general_ci  DEFAULT NULL COMMENT '商品编码',
    `shop_goods_name`      varchar(64) COLLATE utf8mb4_general_ci  DEFAULT NULL COMMENT '商品名称',
    `goods_unit`           char(2) COLLATE utf8mb4_general_ci      DEFAULT NULL COMMENT '单位【关联字典管理】',
    `goods_unit_desc`      varchar(32) COLLATE utf8mb4_general_ci  DEFAULT NULL COMMENT '单位描述',
    `plan_number`          int                                     DEFAULT '0' COMMENT '计划数量',
    `warehousing_number`   int                                     DEFAULT '0' COMMENT '实际数量',
    `more_number`          int                                     DEFAULT '0' COMMENT '多到货数量',
    `shortage_number`      int                                     DEFAULT '0' COMMENT '到货短少数量',
    `unit_price`           decimal(15, 2)                          DEFAULT '0.00' COMMENT '未税单价',
    `tax_unit_price`       decimal(15, 2)                          DEFAULT '0.00' COMMENT '含税单价',
    `rate`                 decimal(15, 2)                          DEFAULT '0.00' COMMENT '税率',
    `tax`                  decimal(15, 2)                          DEFAULT '0.00' COMMENT '合计税额',
    `untaxed_amount`       decimal(15, 2)                          DEFAULT '0.00' COMMENT '未税金额',
    `discount_price`       decimal(15, 2)                          DEFAULT '0.00' COMMENT '折让金额',
    `amount`               decimal(15, 2)                          DEFAULT '0.00' COMMENT '含税金额',
    `del_flag`             char(1) COLLATE utf8mb4_general_ci      DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
    `create_by`            varchar(64) COLLATE utf8mb4_general_ci  DEFAULT '' COMMENT '创建者',
    `create_time`          datetime                                DEFAULT NULL COMMENT '创建时间',
    `update_by`            varchar(64) COLLATE utf8mb4_general_ci  DEFAULT '' COMMENT '更新者',
    `update_time`          datetime                                DEFAULT NULL COMMENT '更新时间',
    `remark`               varchar(500) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
    `dept_id`              bigint NOT NULL COMMENT '部门ID',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  AUTO_INCREMENT = 19
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci COMMENT ='商品入库单子表';

